import React from "react";

const Contact = () => {
  return (
    <section id="contact" className="py-20 bg-gray-100">
      <h2 className="text-center text-4xl font-bold mb-10">Contact Us</h2>
      <form className="max-w-lg mx-auto bg-white p-6 rounded shadow">
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-700">Name</label>
          <input type="text" className="mt-1 p-2 w-full border rounded" placeholder="Enter your name" />
        </div>
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-700">Email</label>
          <input type="email" className="mt-1 p-2 w-full border rounded" placeholder="Enter your email" />
        </div>
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-700">Message</label>
          <textarea className="mt-1 p-2 w-full border rounded" placeholder="Enter your message"></textarea>
        </div>
        <button type="submit" className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600">
          Submit
        </button>
      </form>
    </section>
  );
};

export default Contact;
